// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/security/Pausable.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC20/extensions/draft-ERC20Permit.sol";

contract PuppyBreeder is ERC20, Pausable, Ownable, ERC20Permit {

    uint256 constant public rate = 200000000000000;
    uint256 immutable public maxRewards = 700000 * 10 ** decimals();
    uint256 public publicSaleRemaining = 9000000 * 10 ** decimals();
    uint256 public amountRewarded = 0;

    event LogRewardReceived(address recipient, uint256 rewardAmount, uint256 rewardsRemaining);


    constructor() ERC20("DogePups", "DOGEPUPS") ERC20Permit("DogePups") {
        _mint(address(this), 10000000 * 10 ** decimals());

        //Founder share
        _transfer(address(this), msg.sender, 300000 * 10 ** decimals());
    }

    function buy(uint256 amountOfPups) external payable whenNotPaused {

      uint256 amtWithDecimals = amountOfPups * 10 ** decimals();
      require(publicSaleRemaining >= amtWithDecimals, "Lower request, not enough in Mint");
      require(publicSaleRemaining > 0, "Mint is empty, buy from markets");
      require(msg.value == (amountOfPups * rate), "Send exact amount to buy 1 = 0.0002 BNB");

      //clear ? let's gooo
      publicSaleRemaining = publicSaleRemaining - amtWithDecimals;
      _transfer(address(this), msg.sender, amtWithDecimals);
    }

    function reward(address recipient, uint256 amountOfPups) external onlyOwner whenNotPaused {
      require(msg.sender != recipient, "Can't reward deployer");
      require(address(0x0) != recipient, "Can't reward burn address");
      uint256 amtWithDecimals = amountOfPups * 10 ** decimals();
      require((amountRewarded  +  amtWithDecimals) <=  maxRewards, "Will exceed max.rewards allowed");

      //clear to go

      amountRewarded = amountRewarded + amtWithDecimals;
      _transfer(address(this), recipient, amtWithDecimals);
      emit LogRewardReceived(recipient, amtWithDecimals, (maxRewards - amountRewarded) );
    }


    function pause() public onlyOwner {
        _pause();
    }

    function unpause() public onlyOwner {
        _unpause();
    }

    /**
     * Withdraw balance to wallet
     */
    function withdraw() public onlyOwner returns(bool) {
       payable(msg.sender).transfer(address(this).balance);
       return true;
    }

    function _beforeTokenTransfer(address from, address to, uint256 amount)
        internal
        whenNotPaused
        override
    {
        super._beforeTokenTransfer(from, to, amount);
    }
}
